import React from 'react'
import { useNavigate } from 'react-router-dom';

export const SPHistory: React.FC = () => {
    const navigate = useNavigate();
    const handleClick = () => {
        navigate("/HistoryShowMore");
    };
    return (
        <div>
            <h1 style={{
                display: 'flex',
                left: "520px",
                top: "-450px",
                position: "relative",
                fontFamily: "Figma Hand",
                color: "#ccc",
                fontSize: "21px",
                lineHeight: "150%",
                textAlign: "justify",
                fontStyle: "normal",
                fontWeight: 400,
                // zIndex: 66,
            }}>History</h1>
            <div
                style={{
                    backgroundColor: "#ccc",
                    borderRadius: "2%",
                    position: "relative",
                    width: "400px",
                    height: "500px",
                    left: "350px",
                    top: "-450px",
                    display: "flex",
                    flexDirection: "column",
                    // justifyContent: "center", 
                    alignItems: "center"
                }}
            >

                <div style={{
                    display: "flex",
                    width: "397px",
                    height: "150px",
                    borderRadius: "30%/35%",
                    border: "1.5px dashed red",
                    color: "#B12D2D",
                    marginBottom: "10px",
                    marginBlockStart: "10px",
                    // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                    left: "100px",
                    top: "40.55px",
                }}>
                    <div style={{
                        display: "flex",
                        position: "relative",
                        width: "120px",
                        height: "80px",
                        borderRadius: "10%",
                        border: "1.5px solid white",
                        color: "#ccc",
                        // marginBottom: "20px",
                        // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                        left: "240px",
                        top: "30.55px",
                    }}>

                    </div>
                </div>
                <div style={{
                    display: "flex",
                    width: "397px",
                    height: "150px",
                    borderRadius: "30%/35%",
                    border: "1.5px dashed red",
                    color: "#B12D2D",
                    marginBottom: "10px",
                    // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                    left: "100px",
                    top: "40.55px",
                }}>
                    <div style={{
                        display: "flex",
                        position: "relative",
                        width: "120px",
                        height: "80px",
                        borderRadius: "10%",
                        border: "1.5px solid white",
                        color: "#ccc",
                        // marginBottom: "20px",
                        // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                        left: "240px",
                        top: "30.55px",
                    }}>

                    </div>
                </div>
                <div style={{
                    display: "flex",
                    width: "397px",
                    height: "150px",
                    borderRadius: "30%/35%",
                    border: "1.5px dashed red",
                    color: "#B12D2D",
                    marginBottom: "10px",
                    // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                    left: "100px",
                    top: "40.55px",
                }}>
                    <div style={{
                        display: "flex",
                        position: "relative",
                        width: "120px",
                        height: "80px",
                        borderRadius: "10%",
                        border: "1.5px solid white",
                        color: "#ccc",
                        // marginBottom: "20px",
                        // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                        left: "240px",
                        top: "30.55px",
                    }}>

                    </div>
                </div>
                <button
                    style={{
                        marginBlockStart: "50px",
                        fontSize: "14px",
                        border: "#ccc",
                        // backgroundColor: "white",
                        color: "#B12D2D",
                        padding: "0px 0px",
                        cursor: "pointer",
                        // borderRadius: "20px",
                    }}
                    onClick={handleClick}>

                    Show more
                </button>
            </div>
        </div>
    )
}
